import React, { useState } from "react";
import { useEffect } from "react";

export const SwitchCheckBox = ({ label, name, getAttToEdit }) => {
  const [changeRadio, setChangeRadio] = useState(false);
  useEffect(() => {
    //console.log(getAttToEdit?.switchShowFilter == 0 ? false : true);
    //setChangeRadio(getAttToEdit?.switchShowFilter == 0 ? false : true);
  
  }, [getAttToEdit]);

  return (
    <div className="form-check form-switch pt-4">
      <FastField
        value={changeRadio}
        onClick={(e) => {
          console.log(e.target.value);
          console.log(changeRadio);
          console.log(!changeRadio);
          setChangeRadio(!changeRadio);
        }}
        id={name}
        name={name}
        type="checkBox"
        className=" pointer"
      />
    </div>
  );
};

